  false,\n\t\"url\": null,\n\t\"notes\": \"This is a graphical polygon dataset depicting
  the polygon boundaries of the twelve (12) Metropolitan Council Districts within
  the Parish of East Baton Rouge. The Council Districts are based on voting precincts
  and census tract data, thus the boundaries change over time. Each council district
  has a corresponding councilmember. One councilmember is elected by the Metropolitan
  Council to serve as Mayor Pro Tem. This body is the legislative authority for the
  City-Parish. The Plan of Government, which created the council, was adopted in 1947
  by referrendum and went into effect in 1949. This dataset conveys the best currently
  (2004) available representation of the Metropolitan Council Districts of EBR Parish.\",\n\t\"license_title\":
